import React from "react";
import recentActivity from "./recentActivity";

const Recent = () => (
  <>
    <h1 className="text-center">
      {recentActivity.map((game, key) => (
        <h3>{game.contentTitle}</h3>
      ))}
    </h1>
  </>
);

export default Recent;
